class Solution(object):
    def appendCharacters(self, s, t):

        sIndex = 0
        tIndex = 0

        while sIndex < len(s) and tIndex < len(t):
            if s[sIndex] == t[tIndex]:
                tIndex = tIndex + 1
            sIndex = sIndex + 1
        
        return len(t) - tIndex
       
           
            

class main():
    s:str = ""
    t:str = ""

    
    sol = Solution()
    ans: int = 0
    ans = sol.appendCharacters(s, t)
    print(ans)